import React from 'react';
import { StyleSheet, Text, SafeAreaView } from 'react-native';

function ReviewDetails(props) {
    const { patient } = props;
    return (
        <SafeAreaView style={styles.card}>
            <text>Analysis To be done</text>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    card: {
        borderRadius: 6,
        elevation: 3,
        backgroundColor: '#fff',
        shadowOffset: { width: 1, height: 1 },
        shadowColor: '#333',
        shadowOpacity: 0.3,
        shadowRadius: 2,
        marginHorizontal: 4,
        marginVertical: 6,
    },
    cardContent: {
        marginHorizontal: 18,
        marginVertical: 8,
    }
});

export default ReviewDetails;
